sys_variable_value.value:
(function execute(inputs, outputs) {
  var settings = new AMenosixSettings();
  outputs.page_size = gs.getProperty('x_enosi_cmdb.api_page_size');

  var searchParams = {};

  var searchLocationCategory = settings.getSearchLocationCategory();
  if(searchLocationCategory && searchLocationCategory.trim()){
  	searchParams.functionalLocationCategory = searchLocationCategory.trim();
  }

  var searchLocationIndicator = settings.getSearchLocationIndicator();
  if(searchLocationIndicator && searchLocationIndicator.trim()){
  	searchParams.functionalLocationIndicator = searchLocationIndicator.trim();
  }

  //"dateFrom": "2022-04-18T13:52:00.471Z",
  var maxRow = parseInt(inputs.maxRow);

  var dateFrom = settings.getDateFromTime(inputs.connectionName);
  if(dateFrom && (maxRow < 1)){
  	searchParams.dateFrom = dateFrom;
  }

  if(searchParams.dateFrom || searchParams.functionalLocationCategory || searchParams.functionalLocationIndicator){
    outputs.search_params = '"searchparams":' + JSON.stringify(searchParams) + ','
  }else{
    outputs.search_params = '';
  }


})(inputs, outputs);

