sys_variable_value.value:
(function parse(inputs, outputs) {


// Optionally skip an item in the stream by setting
// outputs.state = 'SKIP'
//
// JSON Example:
 var item = inputs.sourceItem;
 outputs.targetObject.item = item;


})(inputs, outputs);

(function paginate(variables, pageResponse) {
    
    var maxRow = parseInt(variables.maxRow);
    if(maxRow > -1){
        variables.getNextPage = false;
        return;
    }
    // Use this script to set pagination variables or 
    var totalRecords = parseInt(variables.totalRecords);
    var pageSize = parseInt(variables.pageSize);
    var pageNumber = parseInt(variables.pageNumber);
    gs.info((pageNumber * pageSize) + ' : ' + totalRecords);
    if((pageNumber * pageSize) > totalRecords){
        variables.getNextPage = false;
    }else{
        variables.getNextPage = true;
    }
    variables.pageNumber = (pageNumber + 1) + '';

    // manipulate variables extracted by XPath or JSON Path
})(variables, pageResponse);

